string Multisplit(const string& str, const vector<string>& separators) {
    // Initialize an empty vector to store the result substrings
    vector<string> result;

    // Initialize the separator index to 0 (will be used to track the current separator)
    int separator_index = 0;

    // Initialize an empty stack to store the delimiter indices
    vector<int> delimiter_stack;

    // Iterate through each character in the input string
    for (int i = 0; i < str.size(); ++i) {
        // Check if the current character matches any of the separators
        for (int j = separator_index; j < separators.size(); ++j) {
            // If a match is found, update the separator index and push the delimiter index to the stack
            if (str.substr(i, separators[j].size()) == separators[j]) {
                delimiter_stack.push_back(j);
                separator_index = j + 1;
                break;
            }
        }

        // If no separator match is found, add the current substring to the result vector
        if (j >= separators.size()) {
            result.push_back(str.substr(i));
            continue;
        }

        // Add the matched separator information to the result vector
        result.push_back(str.substr(i, separators[j].size()) + " at position " + to_string(i));
    }

    // Pop the delimiter stack and append the matching substrings to the result vector
    for (int i = delimiter_stack.size() - 1; i >= 0; --i) {
        int delimiter_index = delimiter_stack[i];
